        {
            AreaNumberDensity oneNumberPerSquareMeter = AreaNumberDensity.FromNumberPerSquareMeter(1);
            AreaNumberDensity twoNumberPerSquareMeter = AreaNumberDensity.FromNumberPerSquareMeter(2);

            Assert.True(oneNumberPerSquareMeter < twoNumberPerSquareMeter);
            Assert.True(oneNumberPerSquareMeter <= twoNumberPerSquareMeter);
            Assert.True(twoNumberPerSquareMeter > oneNumberPerSquareMeter);
            Assert.True(twoNumberPerSquareMeter >= oneNumberPerSquareMeter);

            Assert.False(oneNumberPerSquareMeter > twoNumberPerSquareMeter);
            Assert.False(oneNumberPerSquareMeter >= twoNumberPerSquareMeter);
            Assert.False(twoNumberPerSquareMeter < oneNumberPerSquareMeter);
            Assert.False(twoNumberPerSquareMeter <= oneNumberPerSquareMeter);
        }

