        [Fact]
        public void ToString_ReturnsValueAndUnitAbbreviationInCurrentCulture()
        {
            var prevCulture = Thread.CurrentThread.CurrentUICulture;
            Thread.CurrentThread.CurrentUICulture = CultureInfo.GetCultureInfo("en-US");
            try {
                Assert.Equal("1 bn⁻¹", new AreaNumberDensity(1, AreaNumberDensityUnit.NumberPerBarn).ToString());
                Assert.Equal("1 cm⁻²", new AreaNumberDensity(1, AreaNumberDensityUnit.NumberPerSquareCentimeter).ToString());
                Assert.Equal("1 m⁻²", new AreaNumberDensity(1, AreaNumberDensityUnit.NumberPerSquareMeter).ToString());
                Assert.Equal("1 mm⁻²", new AreaNumberDensity(1, AreaNumberDensityUnit.NumberPerSquareMillimeter).ToString());
            }
            finally
            {
                Thread.CurrentThread.CurrentUICulture = prevCulture;
            }
        }

        [Fact]
        public void ToString_WithSwedishCulture_ReturnsUnitAbbreviationForEnglishCultureSinceThereAreNoMappings()
        {
            // Chose this culture, because we don't currently have any abbreviations mapped for that culture and we expect the en-US to be used as fallback.
            var swedishCulture = CultureInfo.GetCultureInfo("sv-SE");

            Assert.Equal("1 bn⁻¹", new AreaNumberDensity(1, AreaNumberDensityUnit.NumberPerBarn).ToString(swedishCulture));
            Assert.Equal("1 cm⁻²", new AreaNumberDensity(1, AreaNumberDensityUnit.NumberPerSquareCentimeter).ToString(swedishCulture));
            Assert.Equal("1 m⁻²", new AreaNumberDensity(1, AreaNumberDensityUnit.NumberPerSquareMeter).ToString(swedishCulture));
            Assert.Equal("1 mm⁻²", new AreaNumberDensity(1, AreaNumberDensityUnit.NumberPerSquareMillimeter).ToString(swedishCulture));
        }

        [Fact]
        public void ToString_SFormat_FormatsNumberWithGivenDigitsAfterRadixForCurrentCulture()
        {
            var oldCulture = CultureInfo.CurrentUICulture;
            try
            {
                CultureInfo.CurrentUICulture = CultureInfo.InvariantCulture;
                Assert.Equal("0.1 m⁻²", new AreaNumberDensity(0.123456, AreaNumberDensityUnit.NumberPerSquareMeter).ToString("s1"));
                Assert.Equal("0.12 m⁻²", new AreaNumberDensity(0.123456, AreaNumberDensityUnit.NumberPerSquareMeter).ToString("s2"));
                Assert.Equal("0.123 m⁻²", new AreaNumberDensity(0.123456, AreaNumberDensityUnit.NumberPerSquareMeter).ToString("s3"));
                Assert.Equal("0.1235 m⁻²", new AreaNumberDensity(0.123456, AreaNumberDensityUnit.NumberPerSquareMeter).ToString("s4"));
            }
            finally
            {
                CultureInfo.CurrentUICulture = oldCulture;
            }
        }

